import React from "react";

export default function Navbar() {
  return (
    <div className="Navbar">
      <table class="reachmeout">
        <tr>
          <td>
            <a
              href="https://github.com/harshpandit2004/bookinator-frontend"
              class="stylisethisbutton"
              title="Github"
            >
              <i class="fab fa-github"></i>
            </a>
          </td>
        </tr>
      </table>
    </div>
  );
}
